import "./App.css";
import "./reset.css";
import { useEffect, useState } from "react";

function App() {
  const [data, setData] = useState();

  useEffect(() => {
    (async () => {
      const result = await fetch(
        "http://localhost:8000/fx"
        // "https://www.alphavantage.co/query?function=FX_DAILY&from_symbol=USD&to_symbol=JPY&apikey=4THZE2SRL8MOGD1C"
      );
      setData(await result.json());
    })();
  }, []);

  return <> {JSON.stringify(data["close"])} </>;
}

export default App;
